geregisseerd door Akan Satayev
met Aitzhanov Berik, Vinnie Jones en Aziz Beyshenaliev

Na de dood van zijn oudere broer komt bodyguard Arsen er achter dat zijn dood geen ongeluk was. Hij wordt gecontacteerd door een geheime organisatie die zijn verhaal bevestigd. Hij besluit koste wat kost de waarheid te achterhalen. Maar bij elke stap die hij maakt komt hij er meer en meer achter hoe machtig de personen zijn die verantwoordelijk zijn voor de dood van zijn broer.



